import React, { useState, useEffect } from 'react';
import Layouts from '../../Layouts/Layouts';
import axios from 'axios';

function Projectdata() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const getData = async () => {
      try {
        const response = await axios.get('http://localhost:5000/projects/allProjects');
        if (response) {
          setData(response.data);
        }
      } catch (error) {
        console.log("Error while fetching data");
      }
    };
    getData();
  }, []);
console.log(data.guide);
  return (
    <Layouts>
      <table>
        <thead>
          <tr>
            <th>SN</th>
            <th>ProjectID</th>
            <th>GuideID</th>
            <th>GuideName</th>
            <th>ReviewerID</th>
            <th>ReviewerName</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {data.map((d, index) => (
            <tr key={index}>
              <th>{d.ProjectID}</th>
              {/* Add other columns as needed */}
            </tr>
          ))}
        </tbody>
      </table>
    </Layouts>
  );
}

export default Projectdata;
